import React, { Component } from "react";
import PostData from "../data/db.json";

const PostList = () => {
  return (
    <div>
      {PostData.cards.map((items, index) => {
        return <h1>{items.title}</h1>;
      })}
    </div>
  );
};

export default PostList;
